// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
import React, {Component} from 'react';
import {  Container, Jumbotron, Row, Col, Button } from 'reactstrap';
import {  Redirect  } from 'react-router-dom';

import "../basics.css";

// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
class Jumbo extends Component{
// ------------------ '(◣_◢)' ------------------
  constructor(props){
    super(props);
    console.log(`JUMBO PROPS: ${props.data.title}`);
    this.state = {
      redirect: false,
      redirect_id: 0
    }
    this.handleRedirect = this.handleRedirect.bind(this);

  }
// ------------------ '(◣_◢)' ------------------
  handleClick(id){
    this.setState({redirect: true, redirect_id: id});
  }

// ------------------ '(◣_◢)' ------------------
  handleRedirect(id){
    if(this.state.redirect){
      if(id===1){
        return (<Redirect to="/works" />);
      }
      else if(id===2){
        return <Redirect to="/services" />
      }
      else if(id===3){
        return <Redirect to="/works" />
      }
      else{
        alert("BUG!");
      }
    }
  }
// ------------------ '(◣_◢)' ------------------
  render(){
    console.log(this.state);
    return(
        <div className="svg_mounts jumbotrono">
          <div className = "container">
          {this.handleRedirect(this.state.redirect_id)}
          <Jumbotron style={{backgroundColor:"transparent"}} fluid>
            <h2 className="yellow-font">{this.props.data.title}</h2>
            <p className="blue-font">{this.props.data.sub}</p>
            <p className="white-font">{this.props.data.sub0}</p>
            <br />
            <br />
                <div className="row">
                        <div className="col" style={{padding: "1%"}} >
                              <Button outline color="secondary" size="lg" block className="white-font" onClick={()=>this.handleClick(1)}>{this.props.data.button0}</Button>
                        </div>

                        <div className="col" style={{padding: "1%"}} >
                              <Button outline color="secondary" size="lg" block className="white-font" onClick={()=>this.handleClick(2)}>{this.props.data.button1}</Button>
                        </div>

                        <div className="col" style={{padding: "1%"}} >
                              <Button outline color="secondary" size="lg" block className="white-font" onClick={()=>this.handleClick(3)}>{this.props.data.button2}</Button>
                        </div>

                </div>
          </Jumbotron>
          </div>
       </div>
      );
    }
// ------------------ '(◣_◢)' ------------------
}
// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------

